export class EquipmentElement {
  elementName: string = "";

  constructor(elementName: string = "") {
    this.elementName = elementName;
  }

  public fromJSON(json: any) {
    for (let propName in json)
      this[propName as keyof EquipmentElement] = json[propName];
    return this;
  }
}
